	function _clone(obj) {
	    if (null == obj || ( "object" != typeof obj && "array" != typeof obj )) return obj;
	    if(Array.isArray(obj) == true) {
	    	return obj.slice();
	    }
	    var copy = obj.constructor();
	    for (var attr in obj) {
	        if (obj.hasOwnProperty(attr)) copy[attr] = obj[attr];
	    }
	    return copy;
	}
	_['clone'] = _clone;




